import './App.scss';
import Comp2 from './Component/Comp2';
import Comp1 from './Component/Comp1';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>

        <Routes>
        <>
          <Route path='/comp1'>
            <Comp1 />
          </Route>

          <Route path='/comp2'>
            <Comp2 />
          </Route>
          </>
        </Routes>

    </BrowserRouter>
  );
}

export default App;
